"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["483"],{67566:function(e){e.exports=JSON.parse('{"name":"Telegram","slug":"telegram","url":"https://github.com/appleboy/drone-telegram","icon":"https://raw.githubusercontent.com/appleboy/drone-telegram/refs/heads/master/images/logo.svg","description":"Plugin for sending Telegram notifications","docs":"<p>The Telegram plugin posts build status messages to your account. The below pipeline configuration demonstrates simple usage:</p>\\n<pre><code class=\\"language-yaml\\">- name: send telegram notification\\n  image: appleboy/drone-telegram\\n  settings:\\n    token: xxxxxxxxxx\\n    to: telegram_user_id\\n</code></pre>\\n<p>Example configuration with photo message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     photo:\\n+       - tests/1.png\\n+       - tests/2.png\\n</code></pre>\\n<p>Example configuration with document message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     document:\\n+       - tests/1.pdf\\n+       - tests/2.pdf\\n</code></pre>\\n<p>Example configuration with sticker message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     sticker:\\n+       - tests/3.png\\n+       - tests/4.png\\n</code></pre>\\n<p>Example configuration with audio message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     audio:\\n+       - tests/audio1.mp3\\n+       - tests/audio2.mp3\\n</code></pre>\\n<p>Example configuration with voice message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     voice:\\n+       - tests/voice1.ogg\\n+       - tests/voice2.ogg\\n</code></pre>\\n<p>Example configuration with location message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     location:\\n+       - 24.9163213,121.1424972\\n+       - 24.9263213,121.1224972\\n</code></pre>\\n<p>Example configuration with venue message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     venue:\\n+       - 24.9163213,121.1424972,title,address\\n+       - 24.3163213,121.1824972,title,address\\n</code></pre>\\n<p>Example configuration with video message:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     video:\\n+       - tests/video1.mp4\\n+       - tests/video2.mp4\\n</code></pre>\\n<p>Example configuration with message format (<code>Markdown</code> or <code>HTML</code>), default as <code>Markdown</code>:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     format: Markdown\\n</code></pre>\\n<p>Example configuration with a custom message template:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     message: &gt;\\n+       {{#success build.status}}\\n+         build {{build.number}} succeeded. Good job.\\n+       {{else}}\\n+         build {{build.number}} failed. Fix me please.\\n+       {{/success}}\\n</code></pre>\\n<p>Example configuration with a custom message template loaded from file:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     message_file: message_file.tpl\\n</code></pre>\\n<p>Example configuration with a generic message template loaded from file, with additional extra vars:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     message_file: message_file.tpl\\n+     template_vars:\\n+       env: testing\\n+       app: MyApp\\n</code></pre>\\n<p>Where <code>message_file.tpl</code> is:</p>\\n<pre><code class=\\"language-bash\\">Build finished for *{{tpl.app}}* - *{{tpl.env}}*\\n\\n{{#success build.status}}\\n  build {{build.number}} succeeded. Good job.\\n{{else}}\\n  build {{build.number}} failed. Fix me please.\\n{{/success}}\\n</code></pre>\\n<p>Example configuration with a custom message template, with extra vars loaded from file (e.g. from previous build steps):</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n+     template_vars_file: build_report.json\\n+     message: &gt;\\n+       {{#success build.status}}\\n+         build {{build.number}} succeeded, artefact version = {{tpl.artefact_version}}.\\n+       {{else}}\\n+         build {{build.number}} failed. Fix me please.\\n+       {{/success}}\\n</code></pre>\\n<p>Where <code>build_report.json</code> is:</p>\\n<pre><code>{\\n  ...\\n  \\"artefact_version\\": \\"0.2.3452\\"\\n  ...\\n}\\n</code></pre>\\n<p>Example configuration with a custom socks5 URL:</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n      message: send message using custom socks5 URL\\n+     socks5: socks5://67.204.21.1:64312\\n</code></pre>\\n<p>Disables link previews for links in this message</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n      message: send message without a link preview\\n+     disable_web_page_preview: true\\n</code></pre>\\n<p>Disables notifications for this message</p>\\n<pre><code class=\\"language-diff\\">  - name: send telegram notification\\n    image: appleboy/drone-telegram\\n    settings:\\n      token: xxxxxxxxxx\\n      to: telegram_user_id\\n      message: send message message silently\\n+     disable_notification: true\\n</code></pre>\\n<h2>Parameter Reference</h2>\\n<p>token\\n: telegram token from <a href=\\"https://core.telegram.org/bots/api\\">telegram developer center</a></p>\\n<p>to\\n: telegram user id (can be requested from the @userinfobot inside Telegram)</p>\\n<p>message\\n: overwrite the default message template</p>\\n<p>message_file\\n: overwrite the default message template with the contents of the specified file</p>\\n<p>template_vars\\n: define additional template vars. Example: <code>var1: hello</code> can be used within the template as <code>tpl.var1</code></p>\\n<p>template_vars_file\\n: load additional template vars from json file. Example: given file content <code>{\\"var1\\":\\"hello\\"}</code>, variable can be used within the template as <code>tpl.var1</code></p>\\n<p>photo\\n: local file path</p>\\n<p>document\\n: local file path</p>\\n<p>sticker\\n: local file path</p>\\n<p>audio\\n: local file path</p>\\n<p>voice\\n: local file path</p>\\n<p>location\\n: local file path</p>\\n<p>video\\n: local file path</p>\\n<p>venue\\n: local file path</p>\\n<p>format\\n: <code>markdown</code> or <code>html</code> format</p>\\n<h2>Template Reference</h2>\\n<p>repo.owner\\n: repository owner</p>\\n<p>repo.name\\n: repository name</p>\\n<p>commit.sha\\n: git sha for current commit</p>\\n<p>commit.branch\\n: git branch for current commit</p>\\n<p>commit.link\\n: git commit link in remote</p>\\n<p>commit.author\\n: git author for current commit</p>\\n<p>commit.email\\n: git author email for current commit</p>\\n<p>commit.message\\n: git current commit message</p>\\n<p>build.status\\n: build status type enumeration, either <code>success</code> or <code>failure</code></p>\\n<p>build.event\\n: build event type enumeration, one of <code>push</code>, <code>pull_request</code>, <code>tag</code>, <code>deployment</code></p>\\n<p>build.number\\n: build number</p>\\n<p>build.tag\\n: git tag for current commit</p>\\n<p>build.link\\n: link the the build results in drone</p>\\n<p>build.started\\n: unix timestamp for build started</p>\\n<p>build.finished\\n: unix timestamp for build finished</p>\\n<h2>Template Function Reference</h2>\\n<p>uppercasefirst\\n: converts the first letter of a string to uppercase</p>\\n<p>uppercase\\n: converts a string to uppercase</p>\\n<p>lowercase\\n: converts a string to lowercase. Example <code>{{lowercase build.author}}</code></p>\\n<p>datetime\\n: converts a unix timestamp to a date time string. Example <code>{{datetime build.started}}</code></p>\\n<p>success\\n: returns true if the build is successful</p>\\n<p>failure\\n: returns true if the build is failed</p>\\n<p>truncate\\n: returns a truncated string to n characters. Example <code>{{truncate build.sha 8}}</code></p>\\n<p>urlencode\\n: returns a url encoded string</p>\\n<p>since\\n: returns a duration string between now and the given timestamp. Example <code>{{since build.started}}</code></p>\\n","tags":["notifications","chat"],"author":"appleboy","containerImage":"docker.io/appleboy/drone-telegram","containerImageUrl":"https://hub.docker.com/r/appleboy/drone-telegram","verified":false,"iconDataUrl":"data:image/svg+xml;base64,"}')}}]);